import { combineReducers } from 'redux'
import reducerUser from './user';
import reducerLogin from './login';
import reducerDepartments from './departments';
import reducerStaff from './staff';
import reducerStatus from './status';
import reducerItem from './item';
import reducerOrder from './order';

const rootReducer = combineReducers({
  user: reducerUser,
  login: reducerLogin,
  departments: reducerDepartments,
  staff: reducerStaff,
  status: reducerStatus,
  item: reducerItem,
  order: reducerOrder
})

export default rootReducer;
